						pop.myMC[i].burger.visible = false;
						pop.myMC[i].cheese.visible = false;
						pop.myMC[i].mushrooms.visible = false;
						pop.myMC[i].lettuce.visible = false;
						pop.myMC[i].tomatoes.visible = false;
