		this.goUpFadeOut = function (arg, howMuch = 100) {
			if (arg.visible == true) {
				var normalY = arg.y;
				var dropY = arg.y - howMuch;
		
		
				arg.visible = true;
				createjs.Tween.get(arg, {
					loop: false
				})
					.to({
						y: dropY,
						alpha: 0
					}, 200, createjs.Ease.getPowIn(2.2));
		
			}
		}
		this.goUpFadeInChangeX = function (arg, myx, howMuch = 100) {
			arg.scaleX = 0.8;
			arg.scaleY = 0.8;
			var normalY = arg.y;
			var newY = arg.y - howMuch;
			var newX = arg.x + myx;
			arg.alpha = 0;
		
			arg.visible = true;
			createjs.Tween.get(arg, {
				loop: false
			})
				.to({
					y: newY,
					x: newX,
					alpha: 100,
					scaleX: 1,
					scaleY: 1
				}, 600, createjs.Ease.getPowOut(2.2))
				.call(function () {
					createjs.Tween.get(arg, {
						loop: true
					})
						.to({
							y: newY + 10
						}, 1000, createjs.Ease.getPowOut(1.2))
						.to({
							y: newY
						}, 1000, createjs.Ease.getPowOut(1.2));
				});
		}
